import React from "react";
import "./TodoItem.css";




function TodoItem() {
  return (
    <div className="TodoItem">

      <label>Task</label>
      <div className="icons">
        <h4>delete </h4>
        <h4>edit</h4>
      </div>
    </div>
  );
}

export default TodoItem;
